    false,nt"url": null,nt"notes": "This is a progress report on analysis of
    thermal data from the Black Rock Desert of northwest Nevada.  Hot springs at Soldier
    Meadows, Fly Ranch, Gerlach, and Pinto Mountains were mapped, and water flows and
    temperatures measured, by G. W. Berry and G. R. Downsin 1965 and 1966. These data
    have been studied further by Frank Hadsell (geophysicist) and L. T. Grose (geologist)
    at the Colorado School of Mines and with the computernfacilities of the School of
    Mines Graduate Research Center, in an effort to determine geothermal power potentials
